import React from "react";
import { BsArrowDownRight, BsArrowUpRight } from "react-icons/bs";
import { Column } from "@ant-design/plots";
// import { Table } from "antd";
const columns = [
  {
    title: "SNo",
    dataIndex: "key",
  },
  {
    title: "Name",
    dataIndex: "name",
  },
  {
    title: "Product",
    dataIndex: "product",
  },
  {
    title: "Status",
    dataIndex: "staus",
  },
];
const data1 = [];
for (let i = 0; i < 46; i++) {
  data1.push({
    key: i,
    name: `Edward King ${i}`,
    product: 32,
    staus: `London, Park Lane no. ${i}`,
  });
}
const Dashboard = () => {
  const data = [
    {
      type: "Jan",
      sales: 100,
    },
    {
      type: "Feb",
      sales: 95,
    },
    {
      type: "Mar",
      sales: 106.4,
    },
    {
      type: "Apr",
      sales: 0 ,
    },
    {
      type: "May",
      sales: 0,
    },
    {
      type: "Jun",
      sales: 0,
    },
    {
      type: "July",
      sales: 0,
    },
    {
      type: "Aug",
      sales: 0,
    },
    // {
    //   type: "Sept",
    //   sales: 38,
    // },
    // {
    //   type: "Oct",
    //   sales: 38,
    // },
    // {
    //   type: "Nov",
    //   sales: 38,
    // },
    // {
    //   type: "Dec",
    //   sales: 38,
    // },
  ];
  const config = {
    data,
    xField: "type",
    yField: "sales",
    color: ({ type }) => {
      return "#ffd333";
    },
    label: {
      position: "middle",
      style: {
        fill: "#FFFFFF",
        opacity: 1,
      },
    },
    xAxis: {
      label: {
        autoHide: true,
        autoRotate: false,
      },
    },
    meta: {
      type: {
        alias: "Month",
      },
      sales: {
        alias: "Income",
      },
    },
  };
  return (
    <div>
      <h3 className="mb-4 title">Dashboard</h3>
      <div className="d-flex justify-content-between align-items-center gap-3">
        <div className="d-flex justify-content-between align-items-end flex-grow-1 bg-white p-3 roudned-3">
          <div>
            <p className="desc">Total</p>
            <h4 className="mb-0 sub-title">Rs 100 Cr.</h4>
          </div>
          <div className="d-flex flex-column align-items-end">
            <h6 className="green">
              <BsArrowUpRight /> 8%
            </h6>
            <p className="mb-0  desc">Compared To January 2023</p>
          </div>
        </div>
        <div className="d-flex justify-content-between align-items-end flex-grow-1 bg-white p-3 roudned-3">
          <div>
            <p className="desc">Total</p>
            <h4 className="mb-0 sub-title">Rs 95 Cr.</h4>
          </div>
          <div className="d-flex flex-column align-items-end">
            <h6 className="red">
              <BsArrowDownRight /> 5%
            </h6>
            <p className="mb-0  desc">Compared To February 2023</p>
          </div>
        </div>
        <div className="d-flex justify-content-between align-items-end flex-grow-1 bg-white p-3 roudned-3">
          <div>
            <p className="desc">Total</p>
            <h4 className="mb-0 sub-title">Rs 106.4 Cr.</h4>
          </div>
          <div className="d-flex flex-column align-items-end">
            <h6 className="green">
              <BsArrowUpRight /> 12%
            </h6>
            <p className="mb-0 desc">Compared To March 2023</p>
          </div>
        </div>
      </div>
      <div className="mt-4">
        <h3 className="mb-5 title">Income Statics</h3>
        <div>
          <Column {...config} />+
        </div>
      </div>
      <div className="mt-4">
        {/* <h3 className="mb-5 title">Recent Orders</h3> */}
        <div>
          {/* <Table columns={columns} dataSource={data1} /> */}
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
